import React, { Component } from "react";

export default class Card extends Component {
  render() {
    return (
      <div>
        <div className="card">
          <p style={{ paddingLeft: "5%" }}>{this.props.title}</p>
          <hr
            style={{
              height: "2px",
              width: "5%",
              color: "gray",
              backgroundColor: "gray"
            }}
          />
        </div>
      </div>
    );
  }
}
